img=inv_solve(inv2d, data_c(:,88), data_c(:,85));
show_fem(img, [1,1])
title('\fontsize{17}Baseline computation frames 88-85')
%%
%K2=max(img.elem_data)
%K1=min(img.elem_data);
colbar = linspace(K1,K2,10);
t_v=colbar; %ticks values
Y = (K2-K1)./2;
X = (K2+K1)./2; 

