    img=inv_solve(inv2d, data_c(:,88),data_c(:,k));
    %subplot(3,4,i)
    %frame=i;
    %title(['Frame ',num2str(frame)])
    img.calc_colours.ref_level= X;
    img.calc_colours.clim= Y;
    cb = colorbar; 
    t_l=linspace(1,255,10);
